A 4-inch by 6-inch picture is enlarged for framing  by tripling its dimensions.  A 2-inch-wide border  is then placed around each side of the enlarged  picture, as shown.  Thin metal framing is sold only  in increments of one foot.  What is the minimum  number of linear feet of framing that must be  purchased to go around the perimeter of the border?

[asy]

draw((0,0)--(14,0)--(14,20)--(0,20)--cycle,linewidth(2));

draw((4,4)--(10,4)--(10,16)--(4,16)--cycle);

label("border",(7,17),N);

label("picture",(7,8),N);

label("frame",(14,5),E);

draw((17.5,7.5)--(14.5,7.5),Arrow);
draw((10.5,7.5)--(13.5,7.5),Arrow);

[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

A running track is the ring formed by two concentric circles. If the circumferences of the two circles differ by $10\pi $ feet, how wide is the track in feet?

[asy]size(100); path g=scale(2)*unitcircle;
filldraw(unitcircle^^g,evenodd+grey,black);
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

Rectangle $ABCD$ is 8 cm by 4 cm. $M$ is the midpoint of $\overline{BC}$ , and $N$ is the midpoint of $\overline{CD}$. What is the number of square centimeters in the area of region $AMCN$?

[asy]
draw((0,0)--(32,0)--(32,16)--(0,16)--cycle);
draw((0,16)--(16,0)--(32,8)--cycle);
label("$A$",(0,16),N);
label("$B$",(32,16),N);
label("$C$",(32,0),S);
label("$D$",(0,0),S);
label("$N$",(16,0),S);
label("$M$",(32,8),E);
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

Twenty-four 4-inch wide square posts are evenly spaced with 5 feet between adjacent posts to enclose a square field, as shown. What is the outer perimeter, in feet, of the fence? Express your answer as a mixed number. [asy]
unitsize(2mm);
defaultpen(linewidth(.7pt));
dotfactor=3;

path[] todraw = (1,9)--(9,9)--(9,1) ^^ (8,9)--(8,8)--(9,8) ^^ (5,9)--(5,8)--(6,8)--(6,9) ^^ (9,5)--(8,5)--(8,6)--(9,6) ^^ (8,8.5)--(6,8.5) ^^ (8.5,8)--(8.5,6) ^^ (5,8.5)--(4,8.5) ^^ (8.5,5)--(8.5,4);
path[] tofill = Circle((1.3,8.5),.15) ^^ Circle((2.1,8.5),.15) ^^ Circle((2.9,8.5),.15) ^^ Circle((8.5,1.3),.15) ^^ Circle((8.5,2.1),.15) ^^ Circle((8.5,2.9),.15);

for(int i = 0; i < 4; ++i)
{
draw(rotate(90*i)*todraw);
fill(rotate(90*i)*tofill);
}
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

As shown in the figure below, a circular park consists of an outer-ring path for walkers (white) and a ring-shaped flower garden (gray) surrounding a central circular fountain (black). The walking path is six feet wide in all places, the garden ring is eight feet wide in all places, and the fountain has a diameter of 10 feet. What is the diameter, in feet, of the circle that is the outer boundary of the walking path?

[asy]import graph;
size(101);
draw(Circle((0,0),19));
filldraw(Circle((0,0),13),gray(.6),black);
fill(Circle((0,0),5),black);
draw("$8'$",(0,5)--(0,13));
draw("$6'$",(13,0)--(19,0));
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

The double-bar graph shows the number of home runs hit by McGwire and Sosa during each month of the 1998 baseball season. At the end of which month were McGwire and Sosa tied in total number of home runs?

[asy]
draw((0,0)--(28,0)--(28,21)--(0,21)--(0,0)--cycle,linewidth(1));

for(int i = 1; i < 21; ++i)
{

draw((0,i)--(28,i));
}

for(int i = 0; i < 8; ++i)
{

draw((-1,3i)--(0,3i));
}

label("0",(-1,0),W);
label("3",(-1,3),W);
label("6",(-1,6),W);
label("9",(-1,9),W);
label("12",(-1,12),W);
label("15",(-1,15),W);
label("18",(-1,18),W);
label("21",(-1,21),W);

for(int i = 0; i < 8; ++i)
{

draw((4i,0)--(4i,-1));
}

filldraw((1,0)--(2,0)--(2,1)--(1,1)--(1,0)--cycle,gray,linewidth(1));
filldraw((5,0)--(6,0)--(6,10)--(5,10)--(5,0)--cycle,gray,linewidth(1));
filldraw((9,0)--(10,0)--(10,16)--(9,16)--(9,0)--cycle,gray,linewidth(1));
filldraw((13,0)--(14,0)--(14,10)--(13,10)--(13,0)--cycle,gray,linewidth(1));
filldraw((17,0)--(18,0)--(18,8)--(17,8)--(17,0)--cycle,gray,linewidth(1));
filldraw((21,0)--(22,0)--(22,10)--(21,10)--(21,0)--cycle,gray,linewidth(1));
filldraw((25,0)--(26,0)--(26,15)--(25,15)--(25,0)--cycle,gray,linewidth(1));

filldraw((6,0)--(7,0)--(7,6)--(6,6)--(6,0)--cycle,black,linewidth(1));
filldraw((10,0)--(11,0)--(11,7)--(10,7)--(10,0)--cycle,black,linewidth(1));
filldraw((14,0)--(15,0)--(15,20)--(14,20)--(14,0)--cycle,black,linewidth(1));
filldraw((18,0)--(19,0)--(19,9)--(18,9)--(18,0)--cycle,black,linewidth(1));
filldraw((22,0)--(23,0)--(23,13)--(22,13)--(22,0)--cycle,black,linewidth(1));
filldraw((26,0)--(27,0)--(27,11)--(26,11)--(26,0)--cycle,black,linewidth(1));

label("Mar",(2,0),S);
label("Apr",(6,0),S);
label("May",(10,0),S);
label("Jun",(14,0),S);
label("Jul",(18,0),S);
label("Aug",(22,0),S);
label("Sep",(26,0),S);
[/asy] [asy]
draw((30,6)--(40,6)--(40,15)--(30,15)--(30,6)--cycle,linewidth(1));
filldraw((31,7)--(34,7)--(34,10)--(31,10)--(31,7)--cycle,black,linewidth(1));
filldraw((31,11)--(34,11)--(34,14)--(31,14)--(31,11)--cycle,gray,linewidth(1));

label("McGwire",(36,12.5));
label("Sosa",(36,8.5));
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

In rectangle $ABCD$, $AB = 6$ cm, $BC = 8$ cm, and $DE = DF$. The area of triangle $DEF$ is one-fourth the area of rectangle $ABCD$. What is the length in centimeters of segment $EF$? Express your answer in simplest radical form.

[asy]
draw((0,0)--(0,24)--(32,24)--(32,0)--cycle);
draw((13,24)--(32,5));
label("$A$",(0,24),W);
label("$B$",(0,0),W);
label("$C$",(32,0),E);
label("$D$",(32,24),E);
label("$E$",(13,24),N);
label("$F$",(32,5),E);
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

For the data whose frequency histogram is shown, by how many days is the mean number of days missed per student greater than the median number of days missed per student for the 15 students? Express your answer as a common fraction.

[asy]
draw((0,0)--(0,6),linewidth(2));
draw((0,0)--(6,0),linewidth(2));

draw((0,0)--(1,0)--(1,3)--(0,3)--(0,0)--cycle,linewidth(2));
draw((1,0)--(2,0)--(2,1)--(1,1)--(1,0)--cycle,linewidth(2));
draw((2,0)--(3,0)--(3,4)--(2,4)--(2,0)--cycle,linewidth(2));
draw((3,0)--(4,0)--(4,1)--(3,1)--(3,0)--cycle,linewidth(2));
draw((4,0)--(5,0)--(5,1)--(4,1)--(4,0)--cycle,linewidth(2));
draw((5,0)--(6,0)--(6,5)--(5,5)--(5,0)--cycle,linewidth(2));

draw((0,1)--(6,1),dashed);
draw((0,2)--(6,2),dashed);
draw((0,3)--(6,3),dashed);
draw((0,4)--(6,4),dashed);
draw((0,5)--(6,5),dashed);

label("0",(.5,0),S);
label("1",(1.5,0),S);
label("2",(2.5,0),S);
label("3",(3.5,0),S);
label("4",(4.5,0),S);
label("5",(5.5,0),S);

label("1",(0,1),W);
label("2",(0,2),W);
label("3",(0,3),W);
label("4",(0,4),W);
label("5",(0,5),W);

label("Number of School Days Missed",(2.5,8));
label("by Mr. Clark's Students",(2.5,7));

label("$\#$ of Days of School Missed",(3,-2));

label(rotate(90)*"$\#$ of Students",(-2,2));
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

Find the area of triangle $ABC$ below.


[asy]

unitsize(1inch);

pair P,Q,R;

P = (0,0);

Q= (sqrt(3),0);

R = (0,1);

draw (P--Q--R--P,linewidth(0.9));

draw(rightanglemark(Q,P,R,3));

label("$A$",P,S);

label("$B$",Q,S);

label("$C$",R,N);

label("$6$",R/2,W);

label("$30^\circ$",(1.25,0),N);

[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

The area of trapezoid $ABCD$ is $164 \text{cm}^2$.  The altitude is $8 \text{cm}$, $AB$ is $10 \text{cm}$, and $CD$ is $17 \text{cm}$.  What is $BC$, in centimeters? [asy]
/* AMC8 2003 #21 Problem */
size(2inch,1inch);
draw((0,0)--(31,0)--(16,8)--(6,8)--cycle);
draw((11,8)--(11,0), linetype("8 4"));
draw((11,1)--(12,1)--(12,0));
label("$A$", (0,0), SW);
label("$D$", (31,0), SE);
label("$B$", (6,8), NW);
label("$C$", (16,8), NE);
label("10", (3,5), W);
label("8", (11,4), E);
label("17", (22.5,5), E);
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

The figure shown consists of a right triangle and two squares. If the figure's total area equals 850 square inches, what is the value of $x$ in inches? [asy]
unitsize(5mm);
defaultpen(linewidth(.7pt)+fontsize(10pt));

draw((0,5)--(0,-2)--(-2,-2)--(-2,0)--(5,0)--(5,5)--cycle--(-2,0));
draw(scale(0.2)*((-1,0)--(-1,1)--(1,1)--(1,0)));
label("$2x$",(-1,0),S);
label("$5x$",(0,2.5),E);
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

In the diagram below, $\overline{AB}\parallel \overline{CD}$ and $\angle AXE$ is $108^\circ$ less than 3 times $\angle CYX$.  Find $\angle BXY$.

[asy]

unitsize(1inch);

pair A,B,C,D,X,Y,EE,F;

A = (0,0);

B=(1,0);

C = (0,0.8);

D=(1,0.8);

EE = (0.35,-0.3);

F = (0.8,1.1);

draw(EE--F);

draw(A--B);

draw(C--D);

dot(A);

dot(B);

dot(C);

dot(D);

dot(EE);

dot(F);

label("$E$",EE,S);

label("$F$",F,N);

X = intersectionpoint(A--B,EE--F);

Y = intersectionpoint(C--D,EE--F);

label("$X$",X,NNW);

label("$Y$",Y,NNW);

label("$A$",A,W);

label("$B$",B,E);

label("$C$",C,W);

label("$D$",D,E);

dot(X);

dot(Y);

[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

Angle PQR is a right angle. The three quadrilaterals shown are squares. The sum of the areas of the three squares is 338 square centimeters. What is the number of square centimeters in the area of the largest square?

[asy]
draw((0,0)--(12,0)--(0,5)--cycle);
dot((0,0));
dot((12,0));
dot((0,5));
draw((0,0)--(0,5)--(-5,5)--(-5,0)--cycle);
draw((0,0)--(0,-12)--(12,-12)--(12,0));
draw((0,5)--(5,17)--(17,12)--(12,0)--cycle);
label("$P$",(0,5),NW);
label("$Q$",(0,0),SE);
label("$R$",(12,0),E);

[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

The altitude to the hypotenuse of a triangle with angles of 30 and 60 degrees is 3 units. What is the area of the triangle, in square units? Express your answer in simplest radical form. [asy]
unitsize(6mm);
defaultpen(linewidth(.7pt)+fontsize(8pt));

real r=2*sqrt(3);

pair A=r*dir(0), B=r*dir(60), C=r*dir(180);
pair F=foot(B,A,C);
draw(A--B--C--cycle);
draw(rightanglemark(A,B,C,8));
draw(B--F,linetype("4 2"));
label("3 units",waypoint(B--F,0.6),W);
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

In the diagram, $AB = 13\text{ cm},$ $DC = 20\text{ cm},$ and $AD = 5\text{ cm}.$ What is the length of $AC,$ to the nearest tenth of a centimeter?

[asy]
draw((0,0)--(5,12)--(21,12)--(5,0)--cycle,black+linewidth(1));
draw((5,12)--(5,0),black+linewidth(1));
draw((0,0)--(21,12),black+linewidth(1));
draw((5,0)--(5,0.5)--(4.5,0.5)--(4.5,0)--cycle,black+linewidth(1));
draw((5,12)--(5.5,12)--(5.5,11.5)--(5,11.5)--cycle,black+linewidth(1));
label("$A$",(0,0),NW);
label("$B$",(5,12),NW);
label("$C$",(21,12),E);
label("$D$",(5,0),SE);
label("13 cm",(0,0)--(5,12),NW);
label("5 cm",(0,0)--(5,0),S);
label("20 cm",(5,0)--(21,12),SE);
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

If $\angle A=20^\circ$ and $\angle AFG=\angle AGF,$ then how many degrees is $\angle B+\angle D?$ [asy]
/* AMC8 2000 #24 Problem */
pair A=(0,80), B=(46,108), C=(100,80), D=(54,18), E=(19,0);
draw(A--C--E--B--D--cycle);
label("$A$", A, W);
label("$B$ ", B, N);
label("$C$", shift(7,0)*C);
label("$D$", D, SE);
label("$E$", E, SW);
label("$F$", (23,43));
label("$G$", (35, 86));
[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

Angle $EAB$ is a right angle, and $BE=9$ units. What is the number of square units in the sum of the areas of the two squares $ABCD$ and $AEFG$?

[asy]
draw((0,0)--(1,1)--(0,2)--(-1,1)--cycle);
draw((0,2)--(2,4)--(0,6)--(-2,4)--cycle);
draw((1,1)--(2,4));
draw((-1,1)--(-2,4));

label("A", (0,2), S);
label("B", (1,1), SE);
label("C", (0,0), S);
label("D", (-1,1), SW);
label("E", (2,4), NE);
label("F", (0,6), N);
label("G", (-2,4), NW);
label("9", (1.5, 2.5), SE);
