Think about it step by step and give your answer at the end in \boxed{}.

Triangle $ABC$ has its vertices $A$, $B$, and $C$ on the sides of a rectangle 4 units by 5 units as shown. What is the area of triangle $ABC$ in square units?

[asy]

fill((0,1)--(4,0)--(2,5)--cycle,lightgray);

for(int i=1; i < 5; ++i){
for(int k=1; k < 4; ++k){
draw((0,i)--(4,i),dashed);
draw((k,0)--(k,5),dashed);
} }

draw((0,0)--(4,0)--(4,5)--(0,5)--(0,0));

draw((0,1)--(4,0)--(2,5)--(0,1));

label("$A$",(0,1),W);
label("$B$",(4,0),SE);
label("$C$",(2,5),N);

[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

A rectangular picture frame is made from one-inch-wide pieces of wood.  The area of just the frame is $18$ square inches, and one of the outer edges of the frame is $5$ inches long.  What is the sum of the lengths of the four interior edges of the frame?

[asy]

size(5cm,5cm);

draw((0,0)--(5,0)--(5,7)--(0,7)--(0,0));

draw((1,1)--(4,1)--(4,6)--(1,6)--(1,1));

fill(((1,1)--(4,1)--(4,6)--(1,6)--cycle),darkblue);

draw (shift(0, 0.5)*((0,7)--(5,7)), Bars);

label("$5''$",(2.5,7.5),N);

draw (shift(0, -0.5)*((4,0)--(5,0)), Bars);

label("$1''$",(4.5,-0.5),S);

draw (shift(0.5,0)*((5,0)--(5,1)), Bars);

label("$1''$",(5.5,0.5),E);

[/asy]
Think about it step by step and give your answer at the end in \boxed{}.

